import { Component } from "react";
import "tachyons";

class SearchBar extends Component{

    render(){
        const { onChangeHandler, className, placeHolder } = this.props;
        return(
        <div>
            <input 
                className={className}
                type="search" 
                placeholder={placeHolder}
                onChange={onChangeHandler}

            /> 
        </div>
        )
    }
}
export default SearchBar;
